import styled from 'styled-components';

export const MainContainer = styled.div`
  display: column;
`;

export const SearchAndButtonContainer = styled.div`
  display: flex;
`;

export const ListItem = styled.div`
  line-height: 1.5rem;
  margin: 0;
  padding: 0.5rem 1rem;

  &:hover {
    background: #0058cc;
  }
`;
